{"1": ["Пришло быстро но не рабочий , продержал на зарядке , не какой реакции", "2021-03-11T15:45:36Z", "", "0", 1, 0, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "4": ["Товар на вид хороший но после первого запуска авто Дастера пускозарядное устройство перестало заряжатся", "2021-02-25T06:06:01Z", "", "0", 0, 1, 2, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "5": ["Товар не работает, не заряжается, не включается, потеря времени, придется возвращать", "2021-02-20T15:09:40Z", "", "0", 2, 0, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "6": ["Хватило только на один раз завести машину, дальше все отключилось и не заряжается. Остались только разъемы и крокодилы, ОЧЕНЬ  плахой товар хотя когда выбирал били неплохие отзывы. НЕ СОВЕТУЮ.", "2021-02-18T04:50:25Z", "", "0", 5, 0, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "7": ["Всё максимально ужасно, не заказывайте это!!!", "2021-02-10T20:50:49Z", "", "0", 3, 0, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "8": ["За место 18000 в нутри стоит акум 3500 mAh. Разëмы выдают по 5.2в и 1.6А . С машиной запускать ещё не пробовал. Опробую дополню отзыв!!", "2021-02-10T19:25:07Z", "", "0", 3, 2, 3, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "9": ["при полном заряде может завести жигули ну а по сути характеристики не соответствуют и смысла от покупки - можно телефон наверное зарядить", "2021-02-02T16:49:21Z", "", "0", 2, 1, 2, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "10": ["Прямо из коробки оказался не рабочим. Думал дело в зарядке, а оказалось, просто китайское фуфло....", "2021-01-30T18:11:02Z", "", "0", 3, 1, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "11": ["Вздулся сильно нагрегся думал что загорится", "2021-01-24T13:10:20Z", "", "0", 3, 1, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "12": ["Отличный аппарат. Завел машину с полоборота. Пришел очень быстро. Коробка целая. Комплектация соответствует описанию. Рекомендую", "2021-01-22T13:26:59Z", "", "0", 1, 6, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "13": ["Два раза при минус 30 успешно завел машину. Так что окупилась штучка, потому как вызывать спецов по отогреву машин - вышло бы дороже.", "2021-01-18T07:08:01Z", "", "0", 3, 4, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "14": ["Получили товар...при курьере проверила - зарядка идет, но не включается,даже фонарик не горит. Думала зарядить надо..ан нет, прочитала инструкцию - при 3-х посточнно горящих лампочках, заряд аккомуоятора 75%. Попробовала зарядить телефон - не риагирует. Т.е. лампочки горят только при зарядке, а сам не включается.Заказывала мужу в подарок.Обидно. Как сделать возврат?", "2020-12-16T09:55:20Z", "", "0", 7, 3, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "16": ["Покупала до Нового года. Не заряжается. Возврат. Деньги не вернули все  ещё.", "2021-01-16T16:28:49Z", "", "0", 3, 1, 2, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "17": ["Заказала ПУ в конце декабря на подарок. Проверили в пункте доставки, оно не заряжалось. Сотрудник пункта предложил ещё дома поставить на зарядку подольше. Что и сделали, но и дома оно не заряжалось. Поэтому составила заявку на брак 29.12., которая до сих пор не рассмотрена. И подарок не состоялся и денег ещё не вернула. Печально...", "2021-01-13T13:42:58Z", "", "0", 7, 1, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "18": ["ОЧЕНЬ РАССТРОЕНА!!!! \r\nУстройство при проверке заряжалось нормально. \r\nВоспользоваться получилось только два раза, заводило машину без всяких проблем. На третий раз корпус распух и лопнул, больше устройство не включается.\r\nТовар некачественный, к покупке НЕ СОВЕТУЮ!!!!\r\nНа сайте нет возможности оформить возврат, обидно!!!\r\nУважаемый магазин, может есть возможность все-таки провести диагностику и заменить товар или вернуть хотя-бы часть денег (вещь ведь не дешевая).", "2021-01-13T05:43:22Z", "", "0", 7, 3, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "19": ["Получил в целости. Заряжается быстро. Пока проверял на телефоне, все работает.", "2020-12-20T12:55:00Z", "", "0", 7, 1, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "21": ["Полное говно, что с вами валдбеоис, зажрались, заберите товар, верните деньги, уже не первый раз такое, зарядное устройство не зарядается, заряд не держит, не включается элементарно, все делал как по инструкции,... Жопа полная...", "2021-01-11T13:17:45Z", "", "0", 8, 1, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "23": ["Товар получил удивила мятая коробка, ПУ не включается, шкала заряда не светится, фонарь не включается, заряда нет. Прошу вернуть деньги.", "2021-01-11T11:42:30Z", "", "0", 8, 2, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "24": ["Пока все соответствует и цвет и красиво упаковано..... но еще не проверяла на качество работы, как проверю, напишу", "2021-01-10T13:57:55Z", "", "0", 0, 4, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "25": ["Проверил в пункте выдачи работал,дома поставил зарядить он 5 минут заряжал,и всё потухло ,даже не успел проверить кроме фонарика.", "2021-01-08T14:01:00Z", "", "0", 6, 1, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "26": ["Получили ПУ не включается. Коробка в которой запечатано устройство видно не первой свежести (помятая) ,а когда вскрыли упаковочный пакет на самой коробке приклеено несколько штрих кодов (это значит товар уже не раз кому то посылали и возвращали ) руководство внутри- такое чувство читали уже не один и не два пользователя на сгибах инструкция вся потертая и порванная. Просим принять товар обратно с возвратом 100% денежных средств. Полный беспредел. Я и раньше такое  комментарии  встречала в отзывах но как-то не верилось, но тут столкнулась сама. Примите товар обратно и верните деньги.", "2021-01-08T08:15:30Z", "", "0", 6, 1, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "27": ["Пришел полностью разряженный.и не заряжается.брак!", "2021-01-07T09:41:31Z", "", "0", 7, 1, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "29": ["Пришел заряженный на 1 деление. Зарядил полностью и сразу использовал по назначению!!! Завел с 3 раза, за каждую попытку съедало 1 деление, за один раз 7-10 проворотов стартера!!! Нужная вещь, даже сказал бы необходимая!!! Двигатель 1,5 бензин. Телефон тоже заряжает без проблем, старенький андроид зарядил на 100% без потерь!", "2021-01-03T16:44:15Z", "", "0", 3, 2, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "30": ["Мне попался бракованный. Не держит заряд. ", "2021-01-03T10:14:55Z", "", "0", 3, 0, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "31": ["Устройство не заряжается и не работает, подарила мужу , обидно что так получилось , прошу сделать возврат денежных средств ", "2021-01-01T21:14:00Z", "", "0", 2, 1, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "32": ["Устройство не заряжается и не работает. Прошу принять возврат!!! И вернуть деньги!!!", "2021-01-01T17:03:18Z", "", "0", 5, 0, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "33": ["Товар отличный с первого раза 1,4 хендай солярис завела. Рекомендую к покупке.", "2020-12-29T03:04:55Z", "", "0", 0, 3, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "34": ["Устройство работает. Машину завел. Супруг доволен. Спасибо!", "2020-12-28T06:09:10Z", "", "0", 0, 1, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "35": ["Спасибо,доволен!", "2020-12-27T17:15:59Z", "", "0", 0, 1, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "36": ["Хорошее устройство, жалко что не включается(. Прошу о рассмотрении заявки на брак и возврата товара. Уже неделя прошла.", "2020-12-27T04:33:00Z", "", "0", 1, 1, 2, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "37": ["Упаковано надёжно, имеется симпатичная сумка для хранения, само устройство сделано аккуратно, есть понятная инструкция. В работе опробовали, прибор стартанул замороженный 1,8л двигатель, который не хотел заводиться с нового рабочего штатного аккумулятора. Заряда пускового устройства хватило на 4 попытки запуска в течении пяти минут, на четвёртой движок заурчал. К покупке рекомендую однозначно, даже на подарок автомобилисту будет и приятно и полезно", "2020-12-23T12:42:19Z", "", "0", 3, 2, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "38": ["Привезли курьером проверили комплектацию все есть.\n\nНО, положенные два часа заряжали результата нет. Товар не включается и ни одна индикация не горит. Как можно вернуть товар и получить новый в рабочем состоянии?", "2020-12-22T16:34:39Z", "", "0", 5, 1, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "39": ["Заявленных 18000 mAh, к сожалению нет!!! Максимум 6000 mAh. При зарядке телефона Honor (ёмкость батареи которого 4000 mAh), осталось одно деление индикатора заряда (из четырёх) на \"пусковом устройстве\",которое было полностью заряжено...", "2020-12-22T11:46:41Z", "", "0", 7, 3, 2, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "40": ["Очень хорошее пусковое устройство. Автомобильный аккумулятор был разряжен в ноль, даже не одна лампочка не горела. Завелся без проблем со второго раза. Дома за два часа устройство зарядилось полностью.", "2020-12-19T11:17:21Z", "", "0", 1, 0, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "42": ["Товар пришёл бракованный, не заряжается от слова совсем! Ни от розетки, ни от компьютера! Думали, что он просто в хлам разряжен, держали положенные 2 часа его на зарядке, в ответ-тишина!", "2020-12-11T12:20:21Z", "", "0", 1, 0, 1, "Пусковое устройство с аккумулятором 18000 mAh", "AT"], "43": ["По всей видимости пишу первая, т.к выбирая прибор конечно ориентируемся  на отзывы.  Но все же решила  купить и не ошиблась, Слава Богу!!!  Сразу же проверила , индикатор  показывал полную зарядку. Машина  простояла 5 дней ,  аккумулятор  полностью в \"0\".   С первого раза завелась   ,  чему очень рада.  Спасибо огромное за такой  суперский гаджет*. Кстати забыла написать машина с двигателем 1.8.", "2020-12-10T13:43:02Z", "", "0", 3, 2, 5, "Пусковое устройство с аккумулятором 18000 mAh", "AT"]}
